import React from 'react';
import ReactDOM from 'react-dom';
import MyApp from './MyApp.tsx';
import './index.css';

const root = ReactDOM.createRoot (
    document.getElementById('root') as HTMLElement );
root.render(
    <React.StrictMode>
        <MyApp />
    </React.StrictMode>
);



